def work_p1(sequence):
  if sequence is None or len(sequence) < 2:
    return 0

  total = 0

  for idx, _ in enumerate(sequence):
    if sequence[idx - 1] == sequence[idx]:
      total += int(sequence[idx])

  return total


def work_p2(sequence):
  if sequence == None or len(sequence) == 0:
    return 0

  total = 0


def run_tests(fn, test_data):
  for idx, t in enumerate(test_data):
    result = fn(t[0])
    if result == t[1]:
      print(f'Test {idx + 1} passed!')
    else:
      print(f'Test {idx + 1} failed! Expected {t[1]} but got {result}')


def main():
  # run_tests(work_p1, p1_tests)
  run_tests(work_p2, p2_tests)


if __name__ == '__main__':
  main()
